    render() {
        return (
            <div className="writing_div">
                <div className="writing_left">
                <Button type="primary" shape="round"  size='large' ghost='true'>
                回首页
                </Button>
                </div>
                {/* <RichTextEditor/> */}
            </div>
        )
    }
}
